$(function(){'use strict';$('.page-scroll a').bind('click',function(t){$('html, body').stop().animate({scrollTop:$($(this).attr('href')).offset().top - 50},1250,'easeInOutExpo');t.preventDefault()});$('.navbar-collapse ul li.page-scroll a').click(function(){$('.navbar-toggle:visible').click()})});$(window).on('scroll',function(){'use strict';($(window).scrollTop() <=0) ? $('.scroll-top').fadeOut():$('.scroll-top').fadeIn()});